import React, {useState} from 'react'
import Langs from "./languages/language.json"

function Navbar() {
    const nav = [
        {
            "title":"Syndico",
            "link":""
        },
        {
            "title":"Module",
            "link":""
        },
        {
            "title":"Contact",
            "link":""
        },
    ]
    const [langid, setLangid] = useState(1)

    const [lang, setLang] = useState(false)

  return (
    <div>
        <div className='navbar'>
            <logo>
                <img src="/images/syndico.png" />
            </logo>
            <ul>
                {nav.map((item,key)=>(
                    <li key={key+1}> <h3> {item.title} </h3> </li>
                ))}
                <li onClick={()=> setLang(!lang)}> <i class="fa-solid fa-globe"></i> </li>
            </ul>
        </div>

        {lang?<div className='langs'>
            <ul>
            {Langs.map((lang,key)=>(
                <li onClick={() => setLangid(lang.id)}><h4> {lang.sub} {lang.id} </h4> </li>
            ))}
            </ul>
        </div> : ""}
        {console.log(setLangid)}

    </div>
  )
}

export default Navbar
